INSERT INTO `products` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(1, 'France', 'Welcoming more than 89 million visitors per year, France is the most visited country in the world. Little wonder, owing to the eternal pull of the cosmopolitan capital of Paris. City breaks to the French capital are always popular with couples, who long to experience the romance of Paris’s historic streets and glistening Eiffel Tower. Furthermore, Paris is a shopping paradise and boasts some of the finest restaurants in the world. On the other hand, France offers an array of Mediterranean beaches along its glamorous Côte d’Azur. The French Riviera is awash with upmarket resort towns and coastal villages, making it another top destination for tourism. France’s diversity doesn’t stop there, as the chateaux and vineyards of the Loire Valley are another reason to visit this European nation.', , 3, 1);
INSERT INTO `products` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(2, 'Spain', 'One of Europe\'s biggest hitters for good reason, Spain pulls tourists in by the millions thanks to its warm weather, laidback vibe and excellent food and wine. Plus, of course, there are some of Europe\'s best beach resorts, mountains, and cultural cities such as Madrid, Seville and Barcelona.', , 3, 1);
INSERT INTO `products` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(4, 'Morocco', 'Morocco is known for being one of the most tolerant of the Arab nations. The country is relatively safe, peaceful and stable. Moroccan people, both Arabic and Berber, are also noted for their warm hospitality and friendly nature.', , 2, 1);
INSERT INTO `products` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(7, 'Brazil', 'Brazil\'s relentlessness, beauty and diversity make it South America\'s go-to destination for travelers looking to find everything in one place. Rio\'s world-famous Copacabana and Ipanema are the beaches first-timers flock to. But nearby Costa Verde, where the jungle meets the sea, is home to equally stunning stretches of sand for those keen to explore. Sao Paolo\'s hectic streets offer an insight into Brazil\'s rapid development, while historic Salvador, with its colorful architecture, showcases the country\'s past. Then, of course, there\'s the Amazon and its rainforest, a vast natural world of rare species and indigenous tribes just waiting to be discovered.', , 5, 1);
INSERT INTO `products` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(8, 'Mexico', 'You\'ll find incredible food, sensational beaches, charming towns and historical remains. While the beach resorts around Cancun attract the bulk of visitors, those who want more than a fly and flop go for Mexico City\'s cultural heft, the coastline of Baja California and traditional towns such as Oaxaca.', , 4, 1);
INSERT INTO `products` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(9, 'Switzerland', 'Switzerland is a landlocked mountainous country in South-Central Europe, bordered by Austria, France, Germany, Italy, and Liechtenstein.\r\n\r\nWith an area of 41,285 km², the country is just slightly smaller than the Netherlands or almost twice the size of the US state of New Jersey.\r\n\r\nSwitzerland has a population of just under 8.7 million people (in 2020); capital city is Bern; the largest city is Zürich. Spoken languages are German, French, Italian and Rumantsch, traditionally spoken in the different regions (cantons) of the country. According to the World Happiness Report 2021, the Swiss Confederation is officially the third-happiest nation on Earth, after Finland and Denmark.\r\n\r\nGeographically the country is divided into three major regions; there are the Swiss Alps in the south. The Alps fade out into the Swiss Plateau with a landscape of rolling hills, plains and large lakes and average elevations between 400 m and 700 m. To the northwest along the French/Swiss border is the Jura, a sub-alpine mountain range.', , 3, 1);
INSERT INTO `products` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(10, 'China', 'China defies easy categorization. A nation of more than 1.3 billion people, stretching from the barren Taklamakan desert in the west to the booming metropolis of Shanghai in the east, it\'s ultramodern and deeply traditional. Getting to know it can take a lifetime, making it a source of endless fascination for explorers and adventurers down the years. Delve into the culture clash of imperial and communist China in Beijing\'s Tiananmen Square, bordered by the Forbidden City and Mao\'s Mausoleum; marvel at the towering limestone mountains of Guilin; and be stunned by the archaeologically arresting Terracotta Army in Xian. China\'s joy lies in its scope for endless discovery.\r\n', , 1, 1);
INSERT INTO `products` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(11, 'Germany', 'One of Europe’s largest countries, Germany encompasses a wide variety of landscapes: the tall, sheer mountains of the south; the sandy, rolling plains of the north; the forested hills of the urbanized west; and the plains of the agricultural east. At the spiritual heart of the country is the magnificent east-central city of Berlin, which rose phoenixlike from the ashes of World War II and now, after decades of partition, is the capital of a reunified Germany, and the Rhine River, which flows northward from Switzerland and is celebrated in visual art, literature, folklore, and song. Along its banks and those of its principal tributaries—among them the Neckar, Main, Moselle, and Ruhr—stand hundreds of medieval castles, churches, picturesque villages, market towns, and centres of learning and culture, including Heidelberg, the site of one of Europe’s oldest universities (founded in 1386), and Mainz, historically one of Europe’s most important publishing centres. All are centrepieces of Germany’s thriving tourist economy, which brings millions of visitors to the country each year, drawn by its natural beauty, history, culture, and cuisine (including its renowned wines and beers).', , 3, 1);
INSERT INTO `products` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(12, 'Finland', 'Finland, country located in northern Europe. Finland is one of the world’s most northern and geographically remote countries and is subject to a severe climate. Nearly two-thirds of Finland is blanketed by thick woodlands, making it the most densely forested country in Europe. Finland also forms a symbolic northern border between western and eastern Europe: dense wilderness and Russia to the east, the Gulf of Bothnia and Sweden to the west.', , 3, 1);
INSERT INTO `products` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(13, 'Sweden', 'Sweden, country located on the Scandinavian Peninsula in northern Europe. The name Sweden was derived from the Svear, or Suiones, a people mentioned as early as 98 CE by the Roman author Tacitus. The country’s ancient name was Svithiod. Stockholm has been the permanent capital since 1523.\r\n\r\nSweden\r\nSweden\r\nSweden occupies the greater part of the Scandinavian Peninsula, which it shares with Norway. The land slopes gently from the high mountains along the Norwegian frontier eastward to the Baltic Sea. Geologically, it is one of the oldest and most stable parts of the Earth’s crust. Its surface formations and soils were altered by the receding glaciers of the Pleistocene Epoch (about 2,600,000 to 11,700 years ago). Lakes dot the fairly flat landscape, and thousands of islands form archipelagoes along more than 1,300 miles (2,100 km) of jagged, rocky coastline. Like all of northwestern Europe, Sweden has a generally favourable climate relative to its northerly latitude owing to moderate southwesterly winds and the warm North Atlantic Current.', , 3, 1);
INSERT INTO `products` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(15, 'Fiji', 'For many the paradise islands in the Pacific are a dream come true. Among 322 islands, of which 109 are civilized (or there live the natives), you\'re sure to find something to your liking. From heavenly lonely places, fun, adrenalin sports and much more. Only a few people think about traveling these islands, for they think there’s nothing more to them as a set of perfect sunny beaches. It’s true, there’s a huge number of paradise beaches, but the land has more to offer than just that. Most people only feel the good vibes of Fiji – nice people, beautiful nature and paradise beaches – an escape to a fantasy.', , 6, 1);
INSERT INTO `products` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(45, 'New Zealand', 'New Zealand is a country of stunning and diverse natural beauty: jagged mountains, rolling pasture land, steep fiords, pristine trout-filled lakes, raging rivers, scenic beaches, and active volcanic zones. These islands are one of Earth\'s most peculiar bioregions, inhabited by flightless birds seen nowhere else such as a nocturnal, burrowing parrot called the kakapo and kiwi. Kiwi are not only one of the national symbols – the others being the silver fern leaf and koru – but also the name New Zealanders usually call themselves.\r\n\r\nThese islands are sparsely populated, particularly away from the North Island, but easily accessible. There are sparklingly modern visitor facilities, and transport networks are well developed with Airports throughout the country and well maintained highways. New Zealand often adds an adventure twist to nature: it\'s the original home of jet-boating through shallow gorges, and bungy jumping off anything high enough to give a thrill.\r\n\r\nMāori culture continues to play an important part in everyday life and government and corporate symbolism with abundant opportunities for visitors to understand and experience both the history and present day forms of Māori life.', , 6, 1);
INSERT INTO `products` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(46, 'Australia', 'Australia is the only country in the world that covers an entire continent. It is one of the largest countries on Earth. Although it is rich in natural resources and has a lot of fertile land, more than one-third of Australia is desert.\r\n\r\nMost Australian cities and farms are located in the southwest and southeast, where the climate is more comfortable. There are dense rain forests in the northeast. The famous outback (remote rural areas) contains the country\'s largest deserts, where there are scorching temperatures, little water, and almost no vegetation.\r\n\r\nRunning around the eastern and southeastern edge of Australia is the Great Dividing Range. This 2,300-mile (3,700-kilometer) stretch of mountain sends water down into Australia\'s most important rivers and the Great Artesian Basin, the largest groundwater source in the world.', , 6, 1);

